import React from 'react';

const CoinOptimizerResult = ({ optimizedCoins }) => {
  return (
    <div>
      <h2>Optimized Coins:</h2>
      <ul>
        {optimizedCoins.map((coin, index) => (
          <li key={index}>{coin}</li>
        ))}
      </ul>
    </div>
  );
};

export default CoinOptimizerResult;
